\begin{questions}
\question
Which of the following is the solution to $x^2 + 6x + 9 = 0$?

\begin{enumerate}[label=\Alph*.]
    \item $x = 3$
    \item $x = -3$
    \item $x = \pm 3$
    \item $x = -3$ (with multiplicity 2)
\end{enumerate}

\textbf{Answer:} D
\end{questions}

